// components/Sidebar/Sidebar.js
import React, { useState } from "react";
import {
  LayoutGrid,
  Monitor,
  Cpu,
  Camera,
  Watch,
  Headphones,
  Bluetooth,
  Cloud,
  Plug,
  ShieldCheck,
  Server,
  HardDrive,
  Lamp,          // ✅ FIXED
  X,
  ChevronLeft,
  Home,
  Package,
  Tag,
  Settings,
} from "lucide-react";

const sidebarIcons = [
  { Icon: Home, label: "Home" },
  { Icon: LayoutGrid, label: "Dashboard" },
  { Icon: Package, label: "Products" },
  { Icon: Monitor, label: "Monitors" },
  { Icon: Cpu, label: "Processors" },
  { Icon: Camera, label: "Cameras" },
  { Icon: Watch, label: "Watches" },
  { Icon: Headphones, label: "Headphones" },
  { Icon: Bluetooth, label: "Bluetooth" },
  { Icon: Tag, label: "Deals" },
  { Icon: Cloud, label: "Cloud" },
  { Icon: Plug, label: "Power" },
  { Icon: ShieldCheck, label: "Security" },
  { Icon: Server, label: "Servers" },
  { Icon: HardDrive, label: "Storage" },
  { Icon: Lamp, label: "Lighting" }, // ✅ FIXED
  { Icon: Settings, label: "Settings" },
];

const Sidebar = ({ isOpen, onClose, expanded = true, onToggleExpand }) => {
  const [activeIndex, setActiveIndex] = useState(0);

  return (
    <>
      {/* Mobile overlay */}
      {isOpen && (
        <div
          onClick={onClose}
          className="fixed inset-0 bg-black/50 z-40 lg:hidden"
        />
      )}

      <aside
        className={`
          fixed top-0 left-0 h-screen z-50
          bg-white border-r border-gray-200
          transition-all duration-300 ease-in-out
          flex flex-col
          ${expanded ? "w-64" : "w-16"}
          ${isOpen ? "translate-x-0" : "-translate-x-full lg:translate-x-0"}
        `}
      >
        {/* Header */}
        <div className="flex items-center justify-between h-16 px-4 border-b">
          {expanded ? (
            <div className="flex items-center gap-2">
              <div className="h-8 w-8 bg-blue-600 rounded-md flex items-center justify-center text-white font-bold">
                DA
              </div>
              <div>
                <p className="text-sm font-semibold">Dhaka Agro</p>
                <p className="text-xs text-gray-500">Store</p>
              </div>
            </div>
          ) : (
            <div className="mx-auto h-8 w-8 bg-blue-600 rounded-md flex items-center justify-center text-white font-bold">
              DA
            </div>
          )}

          <div className="flex gap-2">
            <button
              onClick={onToggleExpand}
              className="hidden lg:flex h-8 w-8 items-center justify-center rounded hover:bg-gray-100"
            >
              <ChevronLeft
                size={18}
                className={`transition-transform ${
                  expanded ? "" : "rotate-180"
                }`}
              />
            </button>

            <button
              onClick={onClose}
              className="lg:hidden h-8 w-8 flex items-center justify-center rounded hover:bg-gray-100"
            >
              <X size={18} />
            </button>
          </div>
        </div>

        {/* Nav */}
        <div className="flex-1 overflow-y-auto p-2 space-y-1">
          {sidebarIcons.map((item, index) => (
            <button
              key={index}
              onClick={() => {
                setActiveIndex(index);
                if (window.innerWidth < 1024) onClose();
              }}
              className={`
                group relative w-full flex items-center gap-3 px-3 py-2.5 rounded-lg
                transition
                ${
                  activeIndex === index
                    ? "bg-blue-600 text-white"
                    : "text-gray-700 hover:bg-gray-100"
                }
              `}
            >
              <item.Icon size={20} />

              {expanded && (
                <span className="text-sm font-medium">{item.label}</span>
              )}

              {!expanded && (
                <span className="absolute left-full ml-2 px-2 py-1 text-xs bg-gray-800 text-white rounded opacity-0 group-hover:opacity-100 whitespace-nowrap">
                  {item.label}
                </span>
              )}
            </button>
          ))}
        </div>
      </aside>
    </>
  );
};

export default Sidebar;
